import './App.css';

function App() {
  return (
    <div className="container">
      <span className='topper'>WHWG</span>
      <div className='rulesBlock'>
        <div>
          <span className='rulesText'>Welcome to the World's Hardest Word Game</span>
        </div>
        <div>
          <span className='rulesText'>You will receive a 3-letter prompt picked from a random word in the dictionary</span>
        </div>
      </div>
    </div>
  );
}

export default App;
